c=A.b([new A.cJ("\ub300\uc6a9\ub7c9 \uc568\ubc94 \ucd08\uae30 \uc9c4\uc785 \uc2dc \ub85c\ub529 \uc18d\ub3c4 \uc800\ud558","10,000\uc7a5 \uc774\uc0c1\uc758 \uc0ac\uc9c4\uc774 \uc788\ub294 \uacbd\uc6b0, \ub9e4\ubc88 \uc804\uccb4 \uc2a4\uce94\uc744 \uc218\ud589\ud558\uc5ec \uc571 \uc9c4\uc785 \uc2dc 3~5\ucd08 \uc774\uc0c1\uc758 \ub51c\ub808\uc774 \ubc1c\uc0dd","\ub9c8\uc9c0\ub9c9\uc73c\ub85c \uc815\ub9ac\ud55c \uc0ac\uc9c4\uc758 \uc778\ub371\uc2a4\ub97c \uc568\ubc94\ubcc4\ub85c \uc601\uad6c \uc800\uc7a5(SharedPreferences)\ud558\uc5ec, \uc7ac\uc9c4\uc785 \uc2dc \uc774\ubbf8 \uc815\ub9ac\ud55c \uc0ac\uc9c4\uc740 \uac74\ub108\ub6f0\uace0 O(1)\ub85c \uc989\uc2dc \ub85c\ub529\ub418\ub3c4\ub85d \uac1c\uc120. \uc815\ub9ac\ub41c \uc0ac\uc9c4 ID \uce90\uc2f1 \uc804\ub7b5\uacfc \ubcd1\ud589\ud558\uc5ec \ucd08\uae30 \ub85c\ub529 \uc18d\ub3c4\ub97c 90% \uc774\uc0c1 \ub2e8\ucd95.","\ub85c\uceec DB(SQLite/Prefs)\ub97c \ud65c\uc6a9\ud55c \uc0c1\ud0dc \uc601\uc18d\ud654\uc758 \uc911\uc694\uc131\uacfc \ub300\ub7c9 \ub370\uc774\ud130 \ucc98\ub9ac \uc2dc O(N) \ube44\uc6a9\uc744 \uc904\uc774\uae30 \uc704\ud55c \uc778\ub371\uc2f1 \uc804\ub7b5 \uc2b5\ub4dd"),new A.cJ("\uc720\uc0ac \uc0ac\uc9c4 \ubd84\uc11d \uc2dc UI \ud504\ub9ac\uc9d5(ANR) \ud604\uc0c1","\uc218\ubc31 \uc7a5\uc758 \uc0ac\uc9c4 \ud788\uc2a4\ud1a0\uadf8\ub7a8\uc744 OpenCV\ub85c \ube44\uad50 \uc5f0\uc0b0\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \uba54\uc778 \uc2a4\ub808\ub4dc\uac00 \uc810\uc720\ub418\uc5b4 UI\uac00 \uba48\ucd94\uace0 \ud130\uce58\uac00 \uba39\ud1b5\uc774 \ub418\ub294 \ud604\uc0c1","Dart\uc758 Isolate(\ubcc4\ub3c4 \uc2a4\ub808\ub4dc)\ub97c \uc0dd\uc131\ud558\uc5ec \ubb34\uac70\uc6b4 \uc774\ubbf8\uc9c0 \ubd84\uc11d \uc5f0\uc0b0\uc744 \ubc31\uadf8\ub77c\uc6b4\ub4dc\ub85c \uaca9\ub9ac. compute/Isolate.run \ud568\uc218\ub97c \ud65c\uc6a9\ud574 \uc5f0\uc0b0 \uacb0\uacfc\ub9cc \uba54\uc778 \uc2a4\ub808\ub4dc\ub85c \ube44\ub3d9\uae30 \uc804\uc1a1\ud558\uc5ec UI \ubd80\ub4dc\ub7ec\uc6c0\uc744 \uc720\uc9c0.","Flutter\uc758 \ub2e8\uc77c \uc2a4\ub808\ub4dc \ubaa8\ub378\uc758 \ud55c\uacc4\ub97c \uc774\ud574\ud558\uace0, Isolate\ub97c \ud1b5\ud55c \ubcd1\ub82c \ucc98\ub9ac\ub97c \ud1b5\ud574 CPU \uc9d1\uc57d\uc801\uc778 \uc791\uc5c5\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \ubd84\uc0b0\ud558\ub294 \ubc29\ubc95 \uccb4\ub4dd"),new A.cJ("\ub3d9\uc601\uc0c1 \uc378\ub124\uc77c \uc0dd\uc131 \ubc0f \uba54\ubaa8\ub9ac \ub204\uc218","\ub9ac\uc2a4\ud2b8\uc5d0 \ub3d9\uc601\uc0c1\uc774 \ud3ec\ud568\ub420 \ub54c\ub9c8\ub2e4 \uc378\ub124\uc77c\uc744 \uc2e4\uc2dc\uac04 \uc0dd\uc131\ud558\uba70 \uc2a4\ud06c\ub864 \ubc84\ubc85\uc784\uacfc \uba54\ubaa8\ub9ac \uc0ac\uc6a9\ub7c9 \uae09\uc99d","PhotoManager\uc758 \uc378\ub124\uc77c \uce90\uc2f1 \uae30\ub2a5\uc744 \ud65c\uc6a9\ud558\uace0, \ubdf0\ud3ec\ud2b8\uc5d0 \ubcf4\uc774\ub294 \ud56d\ubaa9\ub9cc \ub80c\ub354\ub9c1\ud558\ub3c4\ub85d GridView \ucd5c\uc801\ud654. \ub3d9\uc601\uc0c1 \uc7ac\uc0dd \uc2dc\uc5d0\ub9cc \uc815\ubc00\ud55c \ub9ac\uc18c\uc2a4\ub97c \ub85c\ub4dc\ud558\uace0 \ud654\uba74 \uc774\ud0c8 \uc2dc \uc989\uc2dc dispose\ud558\uc5ec \uba54\ubaa8\ub9ac \uc548\uc815\uc131 \ud655\ubcf4.","\ubbf8\ub514\uc5b4 \ub9ac\uc18c\uc2a4\uc758 \uc0dd\uba85\uc8fc\uae30 \uad00\ub9ac\uc640 \ub9ac\uc2a4\ud2b8 \ubdf0\uc5d0\uc11c\uc758 \ub9ac\uc18c\uc2a4 \uc7ac\uc0ac\uc6a9 \uba54\ucee4\ub2c8\uc998\uc5d0 \ub300\ud55c \uc774\ud574 \uc2ec\ud654")],d)
c=A.nB("\uc2a4\ub9c8\ud2b8\ud3f0 \uc6a9\ub7c9\uc774 \ub298\uc5b4\ub098\uba74\uc11c \uac24\ub7ec\ub9ac\uc5d0 \ubd88\ud544\uc694\ud55c \uc0ac\uc9c4(\uc2a4\ud06c\ub9b0\uc0f7, \uc5f0\uc0ac \ub4f1)\uc774 \uc313\uc774\uc9c0\ub9cc, \n\uc774\ub97c \ud558\ub098\uc529 \ud655\uc778\ud558\uace0 \uc0ad\uc81c\ud558\ub294 \uacfc\uc815\uc774 \ub108\ubb34 \uc9c0\ub8e8\ud558\uace0 \ubc88\uac70\ub86d\ub2e4\ub294 \uc810\uc5d0 \ucc29\uc548\ud588\uc2b5\ub2c8\ub2e4. \n\uac8c\uc784\ucc98\ub7fc \uc7ac\ubbf8\uc788\uace0 \ube60\ub974\uac8c \uc0ac\uc9c4\uc744 \uc815\ub9ac\ud560 \uc218 \uc788\ub294 \uacbd\ud5d8\uc744 \uc81c\uacf5\ud558\uace0\uc790 \uac1c\ubc1c\ud588\uc2b5\ub2c8\ub2e4.\n",f,null,"https://apps.apple.com/kr/app/%EC%93%B0%EC%9C%BD/id6756438607","AI \ubd84\uc11d\uacfc \uc2a4\uc640\uc774\ud504 \uc561\uc158\uc744 \uacb0\ud569\ud558\uc5ec \uac00\uc7a5 \ube60\ub974\uace0 \uc7ac\ubbf8\uc788\uac8c \uc568\ubc94 \uc6a9\ub7c9\uc744 \ud655\ubcf4\ud574\uc8fc\ub294 \uc720\ud2f8\ub9ac\ud2f0 \uc571\uc785\ub2c8\ub2e4.","https://github.com/devpark435/swipe_gallery","0","images/sseueug.png",A.b(["\ud074\ub77c\uc6b0\ub4dc(iCloud/Google Photos) \uc5f0\ub3d9 \uc9c0\uc6d0","\uc0ad\uc81c\ub41c \uc0ac\uc9c4 \uc6a9\ub7c9 \ud1b5\uacc4 \ub300\uc2dc\ubcf4\ub4dc","AI \ubd84\uc11d \uc815\ud655\ub3c4 \uc870\uc808 \uc635\uc158 \ucd94\uac00"],i),h,"\ub2e8\uc21c\ud55c UI \uad6c\ud604\uc744 \ub118\uc5b4, \uc218\ub9cc \uc7a5\uc758 \ub85c\uceec \ubbf8\ub514\uc5b4 \ub370\uc774\ud130\ub97c \ub2e4\ub8e8\uba74\uc11c \ubc1c\uc0dd\ud560 \uc218 \uc788\ub294 \n\uba54\ubaa8\ub9ac \uc774\uc288\uc640 \ub80c\ub354\ub9c1 \uc131\ub2a5 \ubb38\uc81c\ub97c \uae4a\uc774 \uc788\uac8c \ud30c\uace0\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. \n\ud2b9\ud788 OpenCV \uc5f0\uc0b0\uc744 Isolate\ub85c \ubd84\ub9ac\ud558\uc5ec UI \ube14\ub85c\ud0b9\uc744 \ud574\uacb0\ud558\uace0, \n\uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc744 \uc704\ud574 \uc568\ubc94 \ud0d0\uc0c9 \uc704\uce58\ub97c \uc601\uad6c \uc800\uc7a5\ud558\ub294 \ub4f1 \ub514\ud14c\uc77c\ud55c UX \ucd5c\uc801\ud654 \uc5ed\ub7c9\uc744 \uae38\ub800\uc2b5\ub2c8\ub2e4.\n","2025.12.05 ~ \uc9c4\ud589 \uc911",B.Iv,e,"\uc2a4\uc640\uc774\ud504 \uc81c\uc2a4\ucc98\ub97c \ud65c\uc6a9\ud55c \uace0\uc131\ub2a5 \uac24\ub7ec\ub9ac \uc815\ub9ac \ubc0f AI \uc911\ubcf5 \uc0ac\uc9c4 \ucd94\ucc9c \uc11c\ube44\uc2a4","\uac1c\uc778 \ud504\ub85c\uc81d\ud2b8",g,"\uc4f0\uc73d (Swipe Gallery)",c)
g=A.b(["7\uac00\uc9c0 \uc774\uc0c1\uc758 \ub2e4\uc591\ud55c \ub9c8\uc778\ub4dc\ub9f5 \ub808\uc774\uc544\uc6c3 \uc9c0\uc6d0 (\ubc29\uc0ac\ud615, \uc218\ud3c9/\uc218\uc9c1 \ub4f1)","\ub178\ub4dc \uac1c\uc218\uc5d0 \ub530\ub978 \uc790\ub3d9 \uc90c \ub808\ubca8 \uc870\uc815 \ubc0f \ud2b9\uc815 \ub178\ub4dc \ud3ec\ucee4\uc2f1 \ub4f1 \uc2a4\ub9c8\ud2b8 \uce74\uba54\ub77c \uae30\ub2a5","\ub178\ub4dc \ud655\uc7a5/\ucd95\uc18c, \ud0ed/\ub871\ud504\ub808\uc2a4 \uc774\ubca4\ud2b8 \ucc98\ub9ac, \ubd80\ub4dc\ub7ec\uc6b4 \ud32c&\uc90c \ub4f1 \ub192\uc740 \uc0c1\ud638\uc791\uc6a9\uc131","\ub178\ub4dc \ubaa8\uc591, \uc5f0\uacb0\uc120 \uc0c9\uc0c1, \uc790\ub3d9 \ud06c\uae30 \uc870\uc808 \ub4f1 \ud48d\ubd80\ud55c \ucee4\uc2a4\ud140 \uc2a4\ud0c0\uc77c\ub9c1 \uc635\uc158","pub.dev \uc815\uc2dd \ud328\ud0a4\uc9c0 \ubc30\ud3ec"],i)
