l=A.nB("\uc601\ud654 \uc815\ubcf4\ub97c \uc27d\uac8c \ucc3e\uc544\ubcf4\uace0 \uc608\ub9e4\ud560 \uc218 \uc788\ub294 \ud1b5\ud569 \ud50c\ub7ab\ud3fc\uc744 \ub9cc\ub4e4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\nTheMovie DB API\ub97c \ud65c\uc6a9\ud558\uc5ec \ud48d\ubd80\ud55c \uc601\ud654 \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uace0, \n\uc0ac\uc6a9\uc790 \uce5c\ud654\uc801\uc778 \uc608\ub9e4 \uc2dc\uc2a4\ud15c\uc744 \uad6c\ud604\ud558\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\n",h,null,null,"TheMovie DB API\ub97c \ud65c\uc6a9\ud558\uc5ec \uc601\ud654 \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uace0 \uc608\ub9e4\ud560 \uc218 \uc788\ub294 \uc571\uc785\ub2c8\ub2e4.","https://github.com/NBCampArchive/CinemaApp","5","images/twelvecinema.png",A.b(["\uacb0\uc81c \uc2dc\uc2a4\ud15c \uc5f0\ub3d9","\ucd94\ucc9c \uc54c\uace0\ub9ac\uc998 \uace0\ub3c4\ud654","\uc131\ub2a5 \ucd5c\uc801\ud654"],i),g,"\uc678\ubd80 API \uc5f0\ub3d9\uacfc \ub370\uc774\ud130 \ucc98\ub9ac, UI \uad6c\ud604 \ub4f1 iOS \uc571 \uac1c\ubc1c\uc758 \n\uae30\ubcf8\uc801\uc778 \uc694\uc18c\ub4e4\uc744 \uc2e4\uc2b5\ud574\ubcfc \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 StoryBoard\ub97c \n\ud65c\uc6a9\ud55c UI \uac1c\ubc1c\uacfc MVC \ud328\ud134 \uc801\uc6a9\uc744 \uacbd\ud5d8\ud588\uc2b5\ub2c8\ub2e4.\n","2024.04.22 ~ 2024.04.28",null,f,"TheMovie DB API\ub97c \ud65c\uc6a9\ud55c \uc601\ud654 \uc815\ubcf4 \ubc0f \uc608\ub9e4 \uc2dc\uc2a4\ud15c","iOS 4\uc778",e,"Twelve Cinema",l)
